import React from 'react';

class Counters extends React.Component {
    render() { 
        return (
            <div className="budget-select mb-2"> 
                <button onClick={() => this.props.onIncreament(this.props.counter)} type="button" className="btn btn-sm btn-dark">
                    Set
                </button> 

                <span className="badge badge-dark ml-2"> {this.props.counters} </span> 
            </div>
        );
    }
}

export default Counters;
